import GameLevel from './GameLevel';

const Level1 = () => (
  <GameLevel level="1" imageSrc="./img/hinh-nen-desktop.jpg" initialAttempts={7} />
);

const Level2 = () => (
  <GameLevel level="2" imageSrc="./img/ngam-va-tai-hinh-nen-dep-cho-may-tinh-556444149b46f6.jpg" initialAttempts={5} />
);

const Level3 = () => (
  <GameLevel level="3" imageSrc="./img/2.jpg" initialAttempts={3} />
);

export { Level1, Level2, Level3 };
